import jsPDF from "jspdf";
(function(jsPDFAPI) {
  var font1 =
    "";
  var callAddFont = function() {
    console.log("length font1", font1.length);
    this.addFileToVFS("ITC Avant Garde Gothic LT-normal.ttf", font1);
    this.addFont(
      "ITC Avant Garde Gothic LT-normal.ttf",
      "ITC Avant Garde Gothic LT",
      "normal"
    );
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
